import React, { Component } from "react";
import MeetingRoomItem from "./MeetingRoomItem";
import PropTypes from "prop-types";

class MeetingRooms extends Component {
  constructor(props) {
    super(props);
    this.state = [];
  }

  render() {
    return this.props.meetingrooms.map((meetingroom) => (
      <MeetingRoomItem
        key={meetingroom.id}
        meetingroom={meetingroom}
        addMeeting={this.props.addMeeting}
      />
    ));
  }
}

//PropTypes
Todos.propTypes = {
  todos: PropTypes.array.isRequired,
};

export default MeetingRooms;
